import React, { useEffect, useState } from 'react';
import '../../../css/contact.css';
const Contact = () => {
 
  return (
    <div>
          <div className="content">
            
                <div className="label">
                    Giới thiệu
                </div>

                <div className="content-item">
                    <div className="title-content">Chào mừng bạn đến với trang web chúng tôi</div>
                    <div className="title">Với sự đa dạng trong danh mục sản phẩm, chúng tôi 
                    cung cấp những mẫu điện thoại từ các thương hiệu hàng đầu trên thị trường,
                     đảm bảo đáp ứng được mọi nhu cầu và mong muốn của khách hàng. Từ những chiếc
                      điện thoại thông minh mới nhất với công nghệ tiên tiến đến những mẫu điện
                       thoại giá trung bình đến những sản phẩm giá rẻ nhưng vẫn đảm bảo chất lượng.</div>
                </div>
          
            </div>  
    </div>

  );
};

export default Contact;
